e=65537




def eea(a,b,m):
	if (b==0):
		return a,1,0
	res=eea(b,a%b, m)
	x1=res[1]
	y1=res[2]
	return res[0],y1,(x1-y1*(a//b))%m

def fmp(b,p,m):
	res=1
	while p>0:
		if p%2==1:
			res = res*b%m
		p>>=1
		b=b*b%m
	return res

